// src/pages/Profile/Profile.jsx
import React, { useState } from 'react';
import './Profile.css';

const Profile = () => {
  const [isEditing, setIsEditing] = useState(false);

  const [profile, setProfile] = useState({
    name: "Noshin Syara",
    email: "noshin.syara@example.com",
    bio: "I love late-night study sessions with tea and cozy blankets üß∏",
    cleanliness: 8,
    sleep: 6,
    noise: 7,
    avatar: "https://api.dicebear.com/9.x/avataaars/svg?seed=Noshin&backgroundColor=b6e3f4" // cute placeholder
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setProfile(prev => ({ ...prev, [name]: value }));
  };

  const handleSave = () => {
    setIsEditing(false);
    alert("Profile updated successfully! ‚ô°");
    // Later ‚Üí send to backend / context
  };

  return (
    <div className="profile-page">
      <div className="container">
        <h1 className="page-title">Your Profile</h1>
        <p className="subtitle">This is how the world sees your roomie vibe‚úß</p>

        <div className="profile-card">
          {/* Avatar + Name */}
          <div style={{ textAlign: 'center', marginBottom: '2rem' }}>
            <img
              src={profile.avatar}
              alt="Your cute avatar"
              style={{
                width: '140px',
                height: '140px',
                borderRadius: '50%',
                border: '6px solid white',
                boxShadow: '0 8px 25px rgba(255,123,140,0.4)',
                marginBottom: '1rem'
              }}
            />
            {isEditing ? (
              <input
                type="text"
                name="name"
                value={profile.name}
                onChange={handleChange}
                style={{
                  fontSize: '1.8rem',
                  fontWeight: 'bold',
                  color: '#ff7b8c',
                  textAlign: 'center',
                  border: '2px dashed #ffb3c1',
                  borderRadius: '12px',
                  padding: '0.4rem',
                  width: '80%',
                  maxWidth: '400px'
                }}
              />
            ) : (
              <h2 style={{
                fontSize: '2.4rem',
                fontFamily: "'Comic Neue', cursive",
                color: '#ff7b8c',
                margin: '0.5rem 0'
              }}>
                {profile.name}
              </h2>
            )}
          </div>

          {/* Personal Information */}
          <h3 className="section-title">Personal Info</h3>
          <div className="info-grid">
            <div className="info-item">
              <div className="info-label">Email</div>
              <div className="info-value">{profile.email}</div>
            </div>

            <div className="info-item">
              <div className="info-label">Little About Me</div>
              {isEditing ? (
                <textarea
                  name="bio"
                  value={profile.bio}
                  onChange={handleChange}
                  rows={3}
                  style={{
                    width: '100%',
                    padding: '0.6rem',
                    border: '2px dashed #ffb3c1',
                    borderRadius: '12px',
                    fontFamily: 'inherit'
                  }}
                />
              ) : (
                <div className="info-value" style={{ whiteSpace: 'pre-wrap' }}>
                  {profile.bio}
                </div>
              )}
            </div>
          </div>

          {/* Preferences */}
          <h3 className="section-title">Your Roomie Preferences</h3>
          <div className="preferences-grid">
            <div className="preference-card">
              <div className="preference-label">Cleanliness</div>
              <div className="preference-score">{profile.cleanliness}</div>
            </div>
            <div className="preference-card">
              <div className="preference-label">Sleep Schedule</div>
              <div className="preference-score">{profile.sleep}</div>
            </div>
            <div className="preference-card">
              <div className="preference-label">Noise Tolerance</div>
              <div className="preference-score">{profile.noise}</div>
            </div>
          </div>

          {/* Action Buttons */}
          <div className="action-buttons">
            {isEditing ? (
              <>
                <button className="save-btn" onClick={handleSave}>
                  Save My Changes ‚ô°
                </button>
                <button
                  className="edit-btn"
                  onClick={() => setIsEditing(false)}
                  style={{ background: '#ffe5d9', color: '#a66f5c' }}
                >
                  Cancel
                </button>
              </>
            ) : (
              <button
                className="edit-btn"
                onClick={() => setIsEditing(true)}
              >
                Edit Profile ‚úèÔ∏è
              </button>
            )}
          </div>
        </div>
      </div>
    </div>
  );
};

export default Profile;
